import Vue from 'vue'
import VueRouter from 'vue-router'
import routes from './router'

console.log('Routes:', routes);

Vue.use(VueRouter)

const router = new VueRouter({
  mode: 'history',
  routes
})

new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
